import logo from './logo.svg';
import './App.css';
import {Link, useNavigate, Route, Routes} from 'react-router-dom';
import Home from './Home';
import About from './About';
import Contact from './Contact';

function App() {
  return (
    <div className="App">
      <Route>
        <Link to="/" element={<Home />} />
      </Route>
    </div>
  );
}

export default App;
